import React from "react";

function Footer() {
  return (
    <footer className="flex border border-t-4">
      <div className="mx-auto container py-8">
        <ul>
          <li>
            <a
              className="text-lg text-gray-800"
              href="https://kisiselveriihlali.com/Anasayfa/"
            >
              KVK Blog
            </a>
          </li>
        </ul>
      </div>
    </footer>
  );
}

export default Footer;
